import { NavLink } from "react-router-dom";
import { RegisterPage } from "../pages/RegisterPage";

export const Auth = () => {
  return (
    <ul>
      <li>
        <link to="/register"> register</link>
      </li>
      <li>Login</li>
    </ul>
  );
};

export default Auth;
